import { useState } from "react";
import FilterSearch from "./FilterSearch";
import FilterStatus from "./FilterStatus";

function Filter(props) {
  const { changeSearchStatus, searchStatus, searchTodoList, setSearchTodoList } = props;
  return (
    <div className="d-flex mt-4">
      <FilterSearch filteredTodoList={filteredTodoList} />
      <FilterStatus
        changeSearchStatus={changeSearchStatus}
        searchStatus={searchStatus}
        searchTodoList={searchTodoList}
        setSearchTodoList={setSearchTodoList}
      />
    </div>
  );
}
export default Filter;
